export default function Profile() {
  return (
    <div>
      <h1>鈴木友也</h1>
      <ul>
        <li>年齢：21歳</li>
        <li>生年月日：2002年6月16日</li>
        <li>性別：男性</li>
      </ul>
    </div>
  )
}
